import { useParams } from "react-router-dom";
import { useSelector, useDispatch } from "react-redux";
import { getDogDetails, cleanDogDetails } from "../../Redux/actions" 
import { useEffect } from "react";
import React from "react";
import styles from "./BreedDetail.modules.css";
import LoadingScreen from "../LoadingScreen/LoadingScreen"

const BreedDetail = () => {

    const { name } = useParams();
    const dispatch = useDispatch();
    const breed = useSelector(state => state.dogDetails)
    console.log("raza:" +  breed)

    React.useEffect(() => {
        const fetchBreedDetails = async () => {
          await dispatch(getDogDetails(name));
        };
        fetchBreedDetails();
        return () => dispatch(cleanDogDetails());
      }, [dispatch, name]);

    if (!breed) {
        return (
            <LoadingScreen />
        )
    }

    console.log(breed[0])

    return (
        <>
            <div>
                <h1>esto es raro af: {breed.weight}</h1>
                <span>{breed.height}</span>
                <img src = {breed.img}/>
            </div>
        </>
    )

}

export default BreedDetail;
